import React from 'react';

function Tournament({ tournament }) {
  return (
    <tr>
      <th colSpan="2">
        {tournament}
      </th>
    </tr>
  );
}

function TournamentTable({ tournaments }) {
  const rows = [];

  tournaments.forEach((tournament) => {
    rows.push(
      <Tournament
        tournament={tournament.tournament} />
    );
  });

  return (
    <table>
      <thead>
        <tr>
          <th>Turniere</th>
        </tr>
      </thead>
      <tbody>{rows}</tbody>
    </table>
  );
}

const TOURNAMENTS = [
  {tournament: "Valorant"},
  {tournament: "Bad Rats"},
];

export default function Home() {
  return (
    <div
      style={{
        margin: '5vh'
      }}
    >
      <h1>Willkommen auf Competico, der einzig wahren E-Sports-Turnier-Website</h1>

      <TournamentTable
        tournaments={TOURNAMENTS} />
    </div>
  );
};
